import React, { useState, useEffect } from 'react';

function App() {
  const [numbers, setNumbers] = useState([]);

  useEffect(() => {
    fetch('/').then(response => response.json()).then(data => setNumbers(data));
  }, []);

  return (
    <div>
      <h1>FizzBuzz</h1>
      <ul>
        {numbers.map((number, index) => (
          <li key={index}>{number}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
